b'$TSLA  &quot;Tesla entry energy storage manufacturer&quot;

Tesla shares reached a new record high of $ 507.26 today# after the entry of this electric car and energy storage manufacturer# listed on the New York Stock Exchange# as of December 21# on the S&amp;P 500 index# has been confirmed. .

This will be the largest entry ever in the S&amp;P 500 index with its market capitalization of $ 478.12 thousand NM. If the company were on the index it would be the seventh largest company# behind Berkshire Hathaway and above Visa.'
